      axios.get('https://dttc-api.herokuapp.com/tourDates', {
        headers: { 'Access-Control-Allow-Origin': '*' }
      })
      .then(res => {
        setTourDateData(res.data)
      }).catch(err => {
        console.log(err)
      })
    })
  }



